import React, { useEffect, useState } from 'react';
import { Typography } from '@mui/material';
import ABTestService from '../../services/api';
import { CampaignResultResponse } from '../../services/types';

const CampaignResults: React.FC = () => {
  const [resultData, setResultData] = useState<CampaignResultResponse[]>([]);

  useEffect(() => {
    const fetchResults = async () => {
      try {
        const response = await ABTestService.getAllCampaignResults();
        if (Array.isArray(response)) {
          setResultData(response);
        } else {
          setResultData([response]);
        }
      } catch (error) {
        console.error('Error fetching campaign results:', error);
      }
    };

    fetchResults();
    const interval = setInterval(fetchResults, 15000);
    return () => clearInterval(interval);
  }, []);

  const formatTime = (seconds: number) => {
    const days = Math.floor(seconds / (24 * 60 * 60));
    const hours = Math.floor((seconds % (24 * 60 * 60)) / (60 * 60));
    const minutes = Math.floor((seconds % (60 * 60)) / 60);
    const secs = Math.floor(seconds % 60);

    let timeString = `${secs} seconds`;
    if (days > 0) timeString = `${days} days ${hours} hours ${minutes} minutes ${secs} seconds`;
    else if (hours > 0) timeString = `${hours} hours ${minutes} minutes ${secs} seconds`;
    else if (minutes > 0) timeString = `${minutes} minutes ${secs} seconds`;

    return timeString;
  };

  const renderMetricsTable = (result: CampaignResultResponse) => {
    const { campaign_name, date_created, confidence_interval, winner, analysis_time, status, control, variants } = result;
    return (
      <div style={{ marginBottom: '20px' }} key={result.campaign_id}>
        <div style={{ display: 'flex', flexWrap: 'wrap', alignItems: 'center' }}>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Campaign Name: {campaign_name}</Typography>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Date Created: {date_created}</Typography>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Confidence Interval: {confidence_interval}</Typography>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Winner: {winner}</Typography>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Analysis Time: {formatTime(analysis_time)}</Typography>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Status: {status}</Typography>
        </div>
        <Typography variant="h6">Control:</Typography>
        <div style={{ marginBottom: '20px' }}>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Name: {control.name}</Typography>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Total Views: {control.total_views}</Typography>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Total Clicks: {control.total_clicks}</Typography>
          <Typography variant="body1" style={{ marginRight: '10px' }}>Click Through Rate: {control.ctr.toPrecision(2)}%</Typography>
        </div>
        <Typography variant="h6">Variants:</Typography>
        <div style={{ marginBottom: '20px' }}>
          {variants.map((variant, index) => (
            <Typography variant="body1" key={index} style={{ marginRight: '10px' }}>
              Name: {variant.name}, Total Views: {variant.total_views}, Total Clicks: {variant.total_clicks}, Click Through Rate: {variant.ctr.toPrecision(2)}%
            </Typography>
          ))}
        </div>
      </div>
    );
  };

  return (
    <div>
      <Typography variant="h4">Campaign Results</Typography>

      {resultData.length > 0 && (
        <div>
          <Typography variant="h5" style={{ marginTop: '20px' }}>Results:</Typography>
          {resultData.map(result => renderMetricsTable(result))}
        </div>
      )}
    </div>
  );
};

export default CampaignResults;
